## A. Rough AUD

We are going to consider the signal model with both delay domain and Doppler domain dimensions are relatively small. Assuming $N^{\prime}=\alpha N$ and $M^{\prime}=\beta M$ are both integers, where $0<\alpha, \beta<1$. The quantization value corresponding to the maximum delay $\tau_{\max }$ is $\widetilde{l}_{\max }^{\prime}=\tau_{\max } M^{\prime} \Delta f=$ $\beta \tau_{\max } M \Delta f \ll 1$ when $\beta$ is particularly small, which implies that any delay parameter $0<\widetilde{l}_{u, b, i}^{\prime} \leq \widetilde{l}_{\max }^{\prime} \ll 1$ is a fractional value. The quantization value corresponding to the maximum Doppler shift is defined as $\widetilde{k}_{\max }^{\prime}=\left[\nu_{\max } N^{\prime} T\right]$. Similar to equation (11), we obtain the reception model as:

$$
\begin{aligned}
& \mathbf{Y}_{b}^{D D}\left[k^{\prime}, l^{\prime}\right] \stackrel{(a)}{=} \frac{1}{N^{\prime} M^{\prime}} \sum_{i} h_{u, b, i} \sum_{k^{\prime \prime}} \mathbf{X}_{u}^{D D}\left[k^{\prime}-k^{\prime \prime}, l^{\prime}\right] e^{j 2 \pi \frac{l^{\prime} k^{\prime} u, b, i}{N^{\prime} M^{\prime}}} \\
& e^{-j 2 \pi \frac{l_{u, b, i}^{\prime}\left(k^{\prime}, u, b, i+\hat{k}_{u, b, i}^{\prime}\right)}{N^{\prime} M^{\prime}}} \frac{1-e^{j 2 \pi \hat{k}_{u, b, i}^{\prime}}}{1-e^{-j 2 \pi \frac{k^{\prime \prime}-k_{u, b, i}^{\prime}-l_{u, b, i}^{\prime}}{N^{\prime}}} \frac{1-e^{-j 2 \pi \widetilde{l}_{u, b, i}^{\prime}}}{1-e^{-j 2 \pi \frac{l_{u, b, i}^{\prime}}{N^{\prime}}}}
\end{aligned}
$$

where $\widetilde{l}_{u, b, i}^{\prime}=\tau_{u, b, i} M^{\prime} \Delta f, k_{u, b, i}^{\prime}=\left[\nu_{u, b, i} N^{\prime} T\right]_{\mathrm{R}}, \hat{k}_{u, b, i}^{\prime}=$ $\nu_{u, b, i} N^{\prime} T-\left[\nu_{u, b, i} N^{\prime} T\right]$ and $k^{\prime \prime} \in\left[k^{\prime}{ }_{u, b, i}-\varepsilon^{\prime}, k^{\prime}{ }_{u, b, i}+\varepsilon^{\prime}\right]$ is defined as the neighborhood of $k^{\prime}{ }_{u, b, i}$ with $\varepsilon^{\prime}$ is a integer with very small value. Due to $l^{\prime}<M^{\prime},-0.5 \leq \hat{k}_{u, b, i}^{\prime}<0.5$, and especially when $M^{\prime}$ is very small and $N^{\prime}$ is larger compared to $M^{\prime}$, equation (a) holds approximately true. The derivation process of the above equation can be found in Appendix B. Unlike equation (11), this reception model is not represented in segments. We define functions:

$$
\begin{gathered}
\phi^{\prime}(k, l)=e^{j 2 \pi \frac{k l}{N M^{\prime}}} \\
\varphi\left(k, k_{i}, \hat{k}_{i}, \hat{l}_{i}, N, M\right)=\frac{1}{N M} \frac{1-e^{j 2 \pi \hat{k}_{i}}}{1-e^{-j 2 \pi \frac{k-k_{i}-\hat{k}_{i}}{N}}} \\
\frac{1-e^{-j 2 \pi \hat{l}_{i}}}{1-e^{-j 2 \pi \frac{l_{i}\left(k_{i}+\hat{k}_{i}\right)}{N M^{\prime}}}}, \\
C(\mathbf{x}, k, \varepsilon)=[\operatorname{circ}(\mathbf{x}, 0), \operatorname{circ}(\mathbf{x}, 1), \ldots, \operatorname{circ}(\mathbf{x}, k+\varepsilon), \\
\operatorname{circ}(\mathbf{x},-\varepsilon), \operatorname{circ}(\mathbf{x},-\varepsilon+1), \ldots, \operatorname{circ}(\mathbf{x},-1)]
\end{gathered}
$$

Where $\operatorname{circ}(\mathbf{x}, i)$ represents the vector obtained by circularly shifting vector $\mathbf{x}$ by $i$ positions. Based on the above definitions, we transform equation (12) into vector form:

$$
\begin{aligned}
& \mathbf{y}_{b}^{p 1} \approx\left(\mathbf{X}_{u}^{p 1} \odot \boldsymbol{\Phi}^{\prime}\right) \mathbf{h}_{u, b}^{D D 1}+\mathbf{n}_{b}^{D D 1} \\
& =\mathbf{A}_{u}^{p 1} \mathbf{h}_{u, b}^{D D 1}+\mathbf{n}_{b}^{D D 1} \in \mathcal{E}^{N^{\prime} M^{\prime} \times 1}
\end{aligned}
$$

where $\mathbf{y}_{b}^{p 1}$ is the vectorization of $\mathbf{Y}_{b}^{D D}$, and

$$
\begin{gathered}
\mathbf{X}_{u}^{p 1}=\left[\begin{array}{c}
C\left(\mathbf{X}_{u}^{\prime D D}(:, 1), k_{m \mathrm{~B}^{\prime}, \varepsilon^{\prime}}\right) \\
C\left(\mathbf{X}_{u}^{\prime D D}(:, 2), k_{m \mathrm{~B}^{\prime}, \varepsilon^{\prime}}\right) \\
\vdots \\
C\left(\mathbf{X}_{u}^{\prime D D}\left(:, M^{\prime}\right), k_{m \mathrm{~B}^{\prime}, \varepsilon^{\prime}}\right)
\end{array}\right] \\
\boldsymbol{\Phi}^{\prime}=\left[\boldsymbol{\Phi}_{1}^{\prime H}, \ldots, \boldsymbol{\Phi}_{l}^{\prime H}, \ldots, \boldsymbol{\Phi}_{M^{\prime}}^{\prime H}\right]^{H}
\end{gathered}
$$

$$
h_{u, b, i}^{D D 1}(t)= \begin{cases}h_{u, b, i} \varphi\left(k_{i}^{\prime}+t^{\prime}, k_{i}^{\prime}, \bar{k}_{i}^{\prime}, \bar{l}_{i}^{\prime}, N^{\prime}, M^{\prime}\right) & \begin{cases}\text { if } k_{i}^{\prime}+t^{\prime}<0, & t=\left(k_{i}^{\prime}{ }_{\max }+2 \varepsilon^{\prime}+1\right)+k_{i}^{\prime}+t^{\prime}+1 \\ 0 & \text { if } k_{i}^{\prime}+t^{\prime} \geq 0, t=k_{i}^{\prime}+t^{\prime}+1\end{cases} \\ & \text { otherwise }\end{cases}
$$

$$
\begin{gathered}
\boldsymbol{\Phi}_{i}^{\prime}=\phi_{t}^{\prime} \otimes \mathbf{1}^{N^{\prime} \times 1} \\
\phi_{l}^{\prime}=\left[\phi^{\prime}(l, 0), \ldots, \phi^{\prime}\left(l, k_{\max }+\varepsilon\right)\right. \\
\phi^{\prime}(l, N-\varepsilon-1), \ldots, \phi^{\prime}(l, N-1)]^{T}
\end{gathered}
$$

$\mathbf{h}_{u, b}^{D D 1} \in \mathbb{C}^{\left(k^{\prime}{ }_{\max }+2 \varepsilon^{\prime}+1\right) \times 1}$, it expressed as

$$
\mathbf{h}_{u, b}^{D D 1}=\sum_{i} \mathbf{h}_{u, b, i}^{D D 1}
$$

$\mathbf{h}_{u, b, i}^{D D 1}$ is presented as in equation (22), where $t^{\prime}$ is an integer and satisfies $-\varepsilon^{\prime} \leq t^{\prime} \leq \varepsilon^{\prime}$. Combining equations (16) and (22), $\mathbf{A}_{u}^{p 1}=\mathbf{X}_{u}^{p 1} \odot \boldsymbol{\Phi}^{\prime}$ can be considered as the known measurement matrix at the AP, $\mathbf{y}_{b}^{p 1}$ as the observed vector and $\mathbf{h}_{u, b}^{D D 1}$ as an unknown sparse vector that can be recovered using compressive sensing methods. In a multiuser scenario, the dimension of the sparse vector expands, allowing us to utilize this model to detect the indices of nonzero entries in the sparse vector and thereby identify potential active UEs. Given the coarse approximations made during rough AUD, especially under conditions where $M^{\prime}$ is notably small, accurate estimation of channel parameters becomes challenging. Therefore, it necessitates further refinement based on initial rough detection for accurate AUD and CE. Detailed elaboration on this can be found in subsequent subsections.

## B. Probability Model

Given an AWGN channel model:

$$
\tilde{\mathbf{Y}}=\tilde{\mathbf{A}} \tilde{\mathbf{X}}+\tilde{\mathbf{N}}
$$

where $\tilde{\mathbf{Y}} \in \mathbb{C}^{L \times M}$ is the observed matrix, $\tilde{\mathbf{A}} \in \mathbb{C}^{L \times K}$ is the measurement matrix (its values are known at the receiver), $\tilde{\mathbf{X}} \in \mathbb{C}^{K \times M}$ is the block sparse matrix to be estimated, and $\tilde{\mathbf{N}} \in \mathbb{C}^{L \times M}$ is the additive noise matrix. Since the Laplacian distribution is defined only for real-valued random variables, we need to convert the complex form model of equation (68) into the following real equivalent model:

$$
\begin{gathered}
\mathbf{Y}=\mathbf{A X}+\mathbf{N} \\
\mathbf{Y} \triangleq\left[\begin{array}{c}
\mathcal{R}\left\{\tilde{\mathbf{Y}}\right\} \\
\mathcal{I}\{\tilde{\mathbf{Y}}\}
\end{array}\right] \in \mathbb{R}^{2 L \times M} \\
\mathbf{A} \triangleq\left[\begin{array}{cc}
\mathcal{R}\left\{\tilde{\mathbf{A}}\right\} & -\mathcal{I}\left\{\tilde{\mathbf{A}}\right\} \\
\mathcal{I}\left\{\tilde{\mathbf{A}}\right\} & \mathcal{R}\left\{\tilde{\mathbf{A}}\right\}
\end{array}\right] \in \mathbb{R}^{2 L \times 2 K} \\
\mathbf{X} \triangleq\left[\begin{array}{c}
\mathcal{R}\left\{\tilde{\mathbf{X}}\right\} \\
\mathcal{I}\left\{\tilde{\mathbf{X}}\right\}
\end{array}\right] \in \mathbb{R}^{2 K \times M} \\
\mathbf{N} \triangleq\left[\begin{array}{c}
\mathcal{R}\left\{\tilde{\mathbf{N}}\right\} \\
\mathcal{I}\left\{\tilde{\mathbf{N}}\right\}
\end{array}\right] \in \mathbb{R}^{2 L \times M}
\end{gathered}
$$

Here, $\mathcal{R}\{\cdot\}$ and $\mathcal{I}\{\cdot\}$ represent the operations of taking the real and imaginary parts of a complex matrix, respectively. In practical systems, the noise variance is often unpredictable. We assume that the communication between the transmitter and receiver occurs over an AWGN channel, i.e.:

$$
p(\mathbf{Y} \mid \mathbf{Z})=\prod_{l, j} \mathcal{N}\left(y_{l, j} ; z_{l, j}, \gamma\right)
$$

where $z_{l, j}$ is $(i, j)$-th element of matirx $\mathbf{Z}, \mathbf{Z}=\mathbf{A X}$ and $\gamma$ denotes the noise variance. Referencing the two-layer hierarchical probabilistic model of SBL, we assume the hyperparameters $\left\{\alpha_{i, j}\right\}$ and establish the probability distribution of $\mathbf{X}$ as:

$$
\begin{aligned}
p(\mathbf{X} \mid \alpha)= & \prod_{0<i<N+1, j} \mathcal{L} \mathcal{A}\left(x_{i, j} ; \tau_{i, j}^{-1}\right) \prod_{N<i<2 N, j} \mathcal{L} \mathcal{A}\left(x_{i, j} ; \tau_{i-N, j}^{-1}\right) \\
= & \prod_{0<i<N+1, j} \frac{1}{2} \tau_{i, j} \exp \left(-\frac{1}{2} \tau_{i, j}\left|x_{i, j}\right|\right) \\
& \prod_{N<i<2 N, j} \frac{1}{2} \tau_{i-N, j} \exp \left(-\frac{1}{2} \tau_{i-N, j}\left|x_{i, j}\right|\right) \\
\tau_{i, j}= & \alpha_{i, j}+\beta \alpha_{i-1, j}+\beta \alpha_{i+1, j}+\beta \alpha_{i, j-1}+\beta \alpha_{i, j+1} \\
& p\left(\alpha_{i, j}\right)=\mathcal{G} \mathcal{A}\left(\alpha_{i, j} ; a, b\right)
\end{aligned}
$$

Among them, $\mathcal{G} \mathcal{A}\left(\alpha_{i, j} ; a, b\right)=\Gamma(a)^{-1} b^{a} \alpha_{i, j}^{a} e^{-b \alpha_{i, j}}$ denotes the Gamma distribution with parameters $a$ and $b . \Gamma(a)=$ $\int_{0}^{\infty} t^{a-1} e^{-t} d t$ is the Gamma funcation. Equation (71) shows that the real and imaginary parts of $\tilde{x}_{i, j}$ share the same hyperparameter $\tau_{i, j}$, as defined in equation (72).
